('1','1','1','Bazowa',NULL,'bazowa',NULL,NULL,NULL),
('2','1','1','Główna',NULL,'glowna',NULL,NULL,NULL),
('3','1','1','Women','<p><strong>You will find here all woman fashion collections.</strong></p>\n<p>This category includes all the basics of your wardrobe and much more:</p>\n<p>shoes, accessories, printed t-shirts, feminine dresses, women\'s jeans!</p>','women',NULL,NULL,NULL),
('4','1','1','Tops','<p>Choose from t-shirts, tops, blouses, short sleeves, long sleeves, tank tops, 3/4 sleeves and more.</p>\r\n<p>Find the cut that suits you the best!</p>','tops',NULL,NULL,NULL),
('5','1','1','T-shirts','<p>The must have of your wardrobe, take a look at our different colors,</p>\r\n<p>shapes and style of our collection!</p>','tshirts',NULL,NULL,NULL),
('6','1','1','Tops','Choose the top that best suits you from the wide variety of tops we have. ','top',NULL,NULL,NULL),
('7','1','1','Blouses','Match your favorites blouses with the right accessories for the perfect look.','blouses',NULL,NULL,NULL),
('8','1','1','Dresses','<p>Find your favorites dresses from our wide choice of evening, casual or summer dresses!</p>\r\n<p>We offer dresses for every day, every style and every occasion.</p>','dresses',NULL,NULL,NULL),
('9','1','1','Casual Dresses','<p>You are looking for a dress for every day? Take a look at</p>\r\n<p>our selection of dresses to find one that suits you.</p>','casual-dresses',NULL,NULL,NULL),
