INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
('2','1','1','Regulamin','Regulamin',NULL,'<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Regulamin sklepu internetowego</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 1</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Postanowienia wstępne</b></p>\n<p></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Sklep internetowy PRZEDLANDO dostępny pod adresem internetowym przedlando.pl ma siedzibę w Gdańsku, al. Grunwaldzka 127.</p>\n</li>\n</ol><p style=\"margin-left:1.27cm;margin-bottom:0cm;line-height:115%;\" align=\"justify\">2. Niniejszy Regulamin skierowany jest zarówno do Konsumentów, jak i do Przedsiębiorców korzystających ze Sklepu i określa zasady korzystania ze Sklepu internetowego oraz zasady i tryb zawierania Umów Sprzedaży z Klientem na odległość za pośrednictwem Sklepu.</p>\n<p style=\"margin-left:1.27cm;margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 2</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Definicje</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Konsument </b>- osoba fizyczna zawierająca ze Sprzedawcą umowę w ramach Sklepu, której przedmiot nie jest związany bezpośrednio z jej działalnością gospodarczą lub zawodową.</p>\n</li>\n</ol><ol start=\"2\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Sprzedawca </b>- Przedlando z siedzibą w Gdańsku przy al. Grunwaldzkiej 127, kod pocztowy 80-244.</p>\n</li>\n</ol><ol start=\"3\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Klient </b>- każdy podmiot dokonujący zakupów za pośrednictwem Sklepu.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Przedsiębiorca </b>- osoba fizyczna, osoba prawna i jednostka organizacyjna niebędąca osobą prawną, której odrębna ustawa przyznaje zdolność prawną, wykonująca we własnym imieniu działalność gospodarczą, która korzysta ze Sklepu.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Sklep </b>- sklep internetowy prowadzony przez Sprzedawcę pod adresem internetowym przedlando.pl</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Umowa zawarta na odległość</b> - umowa zawarta z Klientem w ramach zorganizowanego systemu zawierania umów na odległość (w ramach Sklepu), bez jednoczesnej fizycznej obecności stron, z wyłącznym wykorzystaniem jednego lub większej liczby środków porozumiewania się na odległość do chwili zawarcia umowy włącznie.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Regulamin </b>- niniejszy regulamin Sklepu.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Zamówienie </b>- oświadczenie woli Klienta składane za pomocą Formularza Zamówienia i zmierzające bezpośrednio do zawarcia Umowy Sprzedaży Produktu lub Produktów ze Sprzedawcą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Konto</b> - konto klienta w Sklepie, są w nim gromadzone są dane podane przez Klienta oraz informacje o złożonych przez niego Zamówieniach w Sklepie.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Formularz rejestracji </b>- formularz dostępny w Sklepie, umożliwiający utworzenie Konta.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Formularz zamówienia</b> - interaktywny formularz dostępny w Sklepie umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do Koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Koszyk </b>– element oprogramowania Sklepu, w którym widoczne są wybrane przez Klienta Produkty do zakupu, a także istnieje możliwość ustalenia i modyfikacji danych Zamówienia, w szczególności ilości produktów.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Produkt </b>- dostępna w Sklepie rzecz ruchoma/usługa będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"><b>Umowa Sprzedaży</b> - umowa sprzedaży Produktu zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu internetowego. Przez Umowę Sprzedaży rozumie się też - stosowanie do cech Produktu - umowę o świadczenie usług i umowę o dzieło.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 3<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Wymagania techniczne</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Do korzystania ze Sklepu, w tym przeglądania asortymentu Sklepu oraz składania zamówień na Produkty, niezbędne są:</p>\n<ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">urządzenie końcowe z dostępem do sieci Internet i przeglądarką internetową,</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">aktywne konto poczty elektronicznej (e-mail),</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">włączona obsługa plików cookies,</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">zainstalowany program FlashPlayer.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 4<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Informacje ogólne</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Sprzedawca w najszerszym dopuszczalnym przez prawo zakresie nie ponosi odpowiedzialności za zakłócenia w tym przerwy w funkcjonowaniu Sklepu spowodowane siłą wyższą, niedozwolonym działaniem osób trzecich lub niekompatybilnością Sklepu internetowego z infrastrukturą techniczną Klienta.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Przeglądanie asortymentu Sklepu nie wymaga zakładania Konta. Składanie zamówień przez Klienta na Produkty znajdujące się w asortymencie Sklepu możliwe jest albo po założeniu Konta zgodnie z postanowieniami § 5 Regulaminu albo przez podanie niezbędnych danych osobowych i adresowych umożliwiających realizację Zamówienia bez zakładania Konta.</p>\n</li>\n</ol><ol start=\"3\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Ceny podane w Sklepie są podane w polskich złotych i są cenami brutto (uwzględniają podatek VAT).</p>\n</li>\n</ol><ol start=\"4\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Na końcową (ostateczną) kwotę do zapłaty przez Klienta składa się cena za Produkt oraz koszt dostawy (w tym opłaty za transport, dostarczenie i usługi pocztowe), o której Klient jest informowany na stronach Sklepu w trakcie składania Zamówienia, w tym także w chwili wyrażenia woli związania się Umową Sprzedaży.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku Umowy obejmującej prenumeratę lub świadczenie usług na czas nieoznaczony końcową (ostateczną) ceną jest łączna cena obejmująca wszystkie płatności za okres rozliczeniowy.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Gdy charakter przedmiotu Umowy nie pozwala, rozsądnie oceniając, na wcześniejsze obliczenie wysokości końcowej (ostatecznej) ceny, informacja o sposobie, w jaki cena będzie obliczana, a także o opłatach za transport, dostarczenie, usługi pocztowe oraz o innych kosztach, będzie podana w Sklepie w opisie Produktu.</p>\n</li>\n</ol><p></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 5<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Zakładanie Konta w Sklepie</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Aby założyć Konto w Sklepie, należy wypełnić Formularz rejestracji.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Założenie Konta w Sklepie jest darmowe.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Logowanie się na Konto odbywa się poprzez podanie loginu i hasła ustanowionych w Formularzu rejestracji.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Klient ma możliwość w każdej chwili, bez podania przyczyny i bez ponoszenia z tego tytułu jakichkolwiek opłat usunąć Konto poprzez wysłanie stosownego żądania do Sprzedawcy, w szczególności za pośrednictwem poczty elektronicznej.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 6<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Zasady składania Zamówienia</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W celu złożenia Zamówienia należy:</p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">zalogować się do Sklepu (opcjonalne);</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">wybrać Produkt będący przedmiotem Zamówienia, a następnie kliknąć przycisk „Do koszyka”;</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">zalogować się;</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">wybrać rodzaj przesyłki (sposób dostarczenia Produktu), wpisać dane do faktury, jeśli są inne niż dane odbiorcy Zamówienia,</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">kliknąć przycisk “Zamawiam i płacę” oraz potwierdzić zamówienie, klikając w link przesłany w wiadomości e-mail,</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">wybrać jeden z dostępnych sposobów płatności i w zależności od sposobu płatności, opłacić zamówienie w określonym terminie, z zastrzeżeniem § 7 pkt 3.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 7<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Oferowane metody dostawy oraz płatności</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Klient może skorzystać z następujących metod dostawy lub odbioru zamówionego Produktu:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Przesyłka pocztowa, przesyłka pocztowa pobraniowa,</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Przesyłka kurierska, przesyłka kurierska pobraniowa.</p>\n</li>\n</ol><ol start=\"2\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Klient może skorzystać z następujących metod płatności:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Płatność przelewem na konto Sprzedawcy</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Płatności elektroniczne</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Płatność kartą płatniczą.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">3. Szczegółowe informacje na temat metod dostawy oraz akceptowalnych metod płatności znajdują się za stronach Sklepu.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 8<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Wykonanie umowy sprzedaży</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Zawarcie Umowy Sprzedaży między Klientem a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza zamówienia w Sklepie internetowym zgodnie z § 6 Regulaminu.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem a Sprzedawcą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku wyboru przez Klienta:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">płatności przelewem, płatności elektronicznych albo płatności kartą płatniczą, Klient obowiązany jest do dokonania płatności w terminie 3 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży - w przeciwnym razie zamówienie zostanie anulowane.</p>\n</li>\n</ol><ol start=\"4\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Produkt zostanie wysłany przez Sprzedawcę w terminie wskazanym w jego opisie (z zastrzeżeniem ustępu 5 niniejszego paragrafu), w sposób wybrany przez Klienta podczas składania Zamówienia.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Początek biegu terminu dostawy Produktu do Klienta liczy się od dnia uznania rachunku bankowego Sprzedawcy.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Dostawa Produktu odbywa się wyłącznie na terenie Polski.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. Koszty dostawy Produktu (w tym opłaty za transport, dostarczenie i usługi pocztowe) są wskazywane Klientowi w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.</p>\n</li>\n</ol><p></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 9<br /></b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Prawo odstąpienia od umowy</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument może w terminie 14 dni odstąpić od Umowy Sprzedaży bez podania jakiejkolwiek przyczyny.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Bieg terminu określonego w ust. 1 rozpoczyna się od dostarczenia Produktu Konsumentowi lub wskazanej przez niego osobie innej niż przewoźnik.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku Umowy, która obejmuje wiele Produktów, które są dostarczane osobno, partiami lub w częściach, termin wskazany w ust. 1 biegnie od dostawy ostatniej rzeczy, partii lub części.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku Umowy, która polega na regularnym dostarczaniu Produktów przez czas oznaczony (prenumerata), termin wskazany w ust. 1 biegnie od objęcia w posiadanie pierwszej z rzeczy.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument może odstąpić od Umowy, składając Sprzedawcy oświadczenie o odstąpieniu od Umowy. Do zachowania terminu odstąpienia od Umowy wystarczy wysłanie przez Konsumenta oświadczenia przed upływem tego terminu.</p>\n</li>\n</ol><ol start=\"6\"><li>\n<p>Oświadczenie może być wysłane za pomocą tradycyjnej poczty, faxem bądź drogą elektroniczną poprzez przesłanie oświadczenia na adres e-mail Sprzedawcy lub przez złożenie oświadczenia na stronie internetowej Sprzedawcy.</p>\n</li>\n</ol><ol start=\"7\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku przesłania oświadczenia przez Konsumenta drogą elektroniczną, Sprzedawca niezwłocznie prześle Konsumentowi na podany przez Konsumenta adres e-mail potwierdzenie otrzymania oświadczenia o odstąpieniu od Umowy.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Skutki odstąpienia od Umowy:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku odstąpienia od Umowy zawartej na odległość Umowę uważa się za niezawartą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku odstąpienia od Umowy Sprzedawca zwraca Konsumentowi niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta o odstąpieniu od Umowy, wszystkie dokonane przez niego płatności, w tym koszty dostarczenia rzeczy, z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Konsumenta sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez Sprzedawcę.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Zwrotu płatności Sprzedawca dokona przy użyciu takich samych metod płatności, jakie zostały przez Konsumenta użyte w pierwotnej transakcji, chyba że Konsument wyraźnie zgodził się na inne rozwiązanie, które nie będzie się wiązało dla niego z żadnymi kosztami.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Sprzedawca może wstrzymać się ze zwrotem płatności do czasu otrzymania Produktu z powrotem lub do czasu dostarczenia mu dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument powinien odesłać Produkt na adres Sprzedawcy podany w niniejszym Regulaminie niezwłocznie, nie później niż 14 dni od dnia, w którym poinformował Sprzedawcę o odstąpieniu od Umowy. Termin zostanie zachowany, jeśli Konsument odeśle Produkt przed upływem terminu 14 dni.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument ponosi bezpośrednie koszty zwrotu Produktu, także koszty zwrotu Produktu, jeśli ze względu na swój charakter Produkt ten nie mógł zostać w zwykłym trybie odesłany pocztą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument odpowiada tylko za zmniejszenie wartości Produktu wynikające z korzystania z niego w sposób inny niż było to konieczne do stwierdzenia charakteru, cech i funkcjonowania Produktu.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">9. W przypadku gdy ze względu na charakter Produktu nie może on zostać odesłany w zwykłym trybie pocztą, informacja o tym, a także o kosztach zwrotu Produktu, będzie się znajdować w opisie Produktu w Sklepie.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 10</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Reklamacja i gwarancja</b></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Umową Sprzedaży objęte są nowe Produkty.</p>\n</li>\n</ol><ol start=\"2\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Sprzedawca jest obowiązany dostarczyć Klientowi rzecz wolną od wad.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku wystąpienia wady zakupionego u Sprzedawcy towaru Klient ma prawo do reklamacji w oparciu o przepisy dotyczące rękojmi w kodeksie cywilnym.</p>\n</li>\n</ol><ol start=\"4\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Reklamację należy zgłosić pisemnie lub drogą elektroniczną na podane w niniejszym Regulaminie adresy Sprzedawcy.</p>\n</li>\n</ol><ol start=\"5\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Zaleca się, aby w reklamacji zawrzeć m.in. zwięzły opis wady, okoliczności (w tym datę) jej wystąpienia, dane Klienta składającego reklamację, oraz żądanie Klienta w związku z wadą towaru.</p>\n</li>\n</ol><ol start=\"6\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Sprzedawca ustosunkuje się do żądania reklamacyjnego niezwłocznie, nie później niż w terminie 14 dni, a jeśli nie zrobi tego w tym terminie, uważa się, że żądanie Klienta uznał za uzasadnione.</p>\n</li>\n</ol><ol start=\"7\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Towary odsyłane w ramach procedury reklamacyjnej należy wysyłać na adres sklepu.</p>\n</li>\n</ol><ol start=\"8\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku, gdy na Produkt została udzielona gwarancja, informacja o niej, a także jej treść, będą zawarte przy opisie Produktu w Sklepie.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 11</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Pozasądowe sposoby rozpatrywania reklamacji i dochodzenia roszczeń</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Szczegółowe informacje dotyczące możliwości skorzystania przez Konsumenta z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń oraz zasady dostępu do tych procedur dostępne są w siedzibach oraz na stronach internetowych powiatowych (miejskich) rzeczników konsumentów, organizacji społecznych, do których zadań statutowych należy ochrona konsumentów, Wojewódzkich Inspektoratów Inspekcji Handlowej oraz pod następującymi adresami internetowymi Urzędu Ochrony Konkurencji i Konsumentów: http://www.uokik.gov.pl/spory_konsumenckie.php; http://www.uokik.gov.pl/sprawy_indywidualne.php oraz http://www.uokik.gov.pl/wazne_adresy.php.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument uprawniony jest do zwrócenia się do stałego polubownego sądu konsumenckiego, o którym mowa w art. 37 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z późn. zm.), z wnioskiem o rozstrzygnięcie sporu wynikłego z Umowy zawartej ze Sprzedawcą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument uprawniony jest do zwrócenia się do wojewódzkiego inspektora Inspekcji Handlowej, zgodnie z art. 36 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. z 2014 r. poz. 148 z późn. zm.), z wnioskiem o wszczęcie postępowania mediacyjnego w sprawie polubownego zakończenia sporu między Konsumentem a Sprzedawcą.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Konsument może uzyskać bezpłatną pomoc w sprawie rozstrzygnięcia sporu między nim a Sprzedawcą, korzystając także z bezpłatnej pomocy powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich).</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 12</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Dane osobowe w Sklepie internetowym</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<ol><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Administratorem danych osobowych Klientów zbieranych za pośrednictwem Sklepu internetowego jest Sprzedawca.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Dane osobowe Klientów zbierane przez administratora za pośrednictwem Sklepu internetowego zbierane są w celu realizacji Umowy Sprzedaży, a jeżeli Klient wyrazi na to zgodę - także w celu marketingowym.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">Odbiorcami danych osobowych Klientów Sklepu internetowego mogą być:</p>\n</li>\n</ol><ol type=\"a\"><li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku Klienta, który korzysta w Sklepie internetowym ze sposobu dostawy przesyłką pocztową lub przesyłką kurierską, Administrator udostępnia zebrane dane osobowe Klienta wybranemu przewoźnikowi lub pośrednikowi realizującemu przesyłki na zlecenie Administratora.</p>\n</li>\n<li>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">W przypadku Klienta, który korzysta w Sklepie internetowym ze sposobu płatności elektronicznych lub kartą płatniczą Administrator udostępnia zebrane dane osobowe Klienta, wybranemu podmiotowi obsługującemu powyższe płatności w Sklepie internetowym.</p>\n</li>\n</ol><p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">4. Klient ma prawo dostępu do treści swoich danych oraz ich poprawiania.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">5. Podanie danych osobowych jest dobrowolne, aczkolwiek niepodanie wskazanych w Regulaminie danych osobowych niezbędnych do zawarcia Umowy Sprzedaży skutkuje brakiem możliwości zawarcia tejże umowy.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>§ 13</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"center\"><b>Postanowienia końcowe</b></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\"></p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">1. Umowy zawierane poprzez Sklep internetowy zawierane są w języku polskim.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">2. Sprzedawca zastrzega sobie prawo do dokonywania zmian Regulaminu z ważnych przyczyn to jest: zmiany przepisów prawa, zmiany sposobów płatności i dostaw - w zakresie, w jakim te zmiany wpływają na realizację postanowień niniejszego Regulaminu. O każdej zmianie Sprzedawca poinformuje Klienta z co najmniej 7 dniowym wyprzedzeniem.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">3. W sprawach nieuregulowanych w niniejszym Regulaminie mają zastosowanie powszechnie obowiązujące przepisy prawa polskiego, w szczególności: Kodeksu cywilnego; ustawy o świadczeniu usług drogą elektroniczną; ustawy o prawach konsumenta, ustawy o ochronie danych osobowych.</p>\n<p style=\"margin-bottom:0cm;line-height:115%;\" align=\"justify\">4. Klient ma prawo skorzystać z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. W tym celu może złożyć skargę za pośrednictwem unijnej platformy internetowej ODR dostępnej pod adresem: <a href=\"http://ec.europa.eu/consumers/odr/\">http://ec.europa.eu/consumers/odr/</a>.</p>\n<p></p>','legal-notice'),
('3','1','1','Polityka prywatności','Polityka prywatności',NULL,'<p>Polityka prywatności serwisu www.przedlando.pl<br />1. Informacje ogólne<br />Niniejsza Polityka Prywatności określa zasady przetwarzania i ochrony danych osobowych przekazanych przez Użytkowników w związku z korzystaniem przez nich usług poprzez Serwis.<br />2. Administratorem danych osobowych zawartych w serwisie jest PRZEDLANDO z siedzibą w Gdańsku.<br />3. W trosce o bezpieczeństwo powierzonych nam danych opracowaliśmy wewnętrzne procedury i zalecenia, które mają zapobiec udostępnieniu danych osobom nieupoważnionym. Kontrolujemy ich wykonywanie i stale sprawdzamy ich zgodność z odpowiednimi aktami prawnymi - ustawą o ochronie danych osobowych, ustawą o świadczeniu usług drogą elektroniczną, a także wszelkiego rodzaju aktach wykonawczych i aktach prawa wspólnotowego.<br />4. Dane Osobowe przetwarzane są na podstawie zgody wyrażanej przez Użytkownika oraz w przypadkach, w których przepisy prawa upoważniają Administratora do przetwarzania danych osobowych na podstawie przepisów prawa lub w celu realizacji zawartej pomiędzy stronami umowy.<br />5. Serwis realizuje funkcje pozyskiwania informacji o użytkownikach i ich zachowaniach w następujący sposób:<br />a) poprzez dobrowolnie wprowadzone w formularzach informacje<br />b) poprzez gromadzenie plików “cookies”.<br />6. Serwis zbiera informacje dobrowolnie podane przez użytkownika.<br />7. dane podane w formularzu są przetwarzane w celu wynikającym z funkcji konkretnego formularza np. w celu dokonania procesu obsługi kontaktu informacyjnego<br />8. Dane osobowe pozostawione w serwisie nie zostaną sprzedane ani udostępnione osobom trzecim, zgodnie z przepisami Ustawy o ochronie danych osobowych.<br />9. Do danych zawartych w formularzu przysługuje wgląd osobie fizycznej, która je tam umieściła. Osoba ta ma również praw do modyfikacji i zaprzestania przetwarzania swoich danych w dowolnym momencie.<br />10. Zastrzegamy sobie prawo do zmiany w polityce ochrony prywatności serwisu, na które może wpłynąć rozwój technologii internetowej, ewentualne zmiany prawa w zakresie ochrony danych osobowych oraz rozwój naszego serwisu internetowego. O wszelkich zmianach będziemy informować w sposób widoczny i zrozumiały.<br />11. W Serwisie mogą pojawiać się linki do innych stron internetowych. Takie strony internetowe działają niezależnie od Serwisu i nie są w żaden sposób nadzorowane przez serwis przedlando.pl. Strony te mogą posiadać własne polityki dotyczące prywatności oraz regulaminy, z którymi zalecamy się zapoznać.<br />W razie wątpliwości co któregokolwiek z zapisów niniejszej polityki prywatności jesteśmy do dyspozycji.</p>','terms-and-conditions-of-use'),
('4','1','1','O nas','Dowiedz się więcej o nas',NULL,'<h2>O nas</h2>\n<p><span class=\"st\">Poznaj szeroki wybór butów i odzieży w PRZEDLANDO - najlepsze marki, darmowa dostawa!<br /></span></p>\n<p></p>\n<p class=\"z-jarvis-rt-text\"><strong class=\"z-jarvis-rt-bold\">PRZEDLANDO</strong></p>\n<p class=\"z-jarvis-rt-text\">al. Grunwaldzka 127</p>\n<p>80-244 Gdańsk</p>\n<p>NIP: 1234567899</p>','about-us'),
